import React from 'react';

const Login = () => {
  const handleChange = () => {};
  return (
    <>
      <div className='form-usuario'>
        <div className='contenedor-form sombra-dark'>
          <h1>Log in</h1>
          <form>
            <div className='compo-form'>
              <label htmlFor='email'>
                <input
                  type='email'
                  id='email'
                  name='email'
                  placeholder='email'
                  onChange={handleChange}
                />
              </label>
            </div>
          </form>
        </div>
      </div>
    </>
  );
};

export default Login;
